import TotalProducts from "../../ProductArea/TotalProducts/TotalUsers";
import "./Footer.css";

function Footer(): JSX.Element {
    return (
        <div className="Footer">
            <p> &copy;Asaf Wallach</p>
            <TotalProducts />
        </div>
    );
}

export default Footer;
